import './App.css';
import MenuPrincipal from './components/MenuPrincipal';
import { Segment } from 'semantic-ui-react';

function App() {
  return (
    <div className='body'>
      <MenuPrincipal></MenuPrincipal>
      <Segment.Group horizontal>
        <Segment ></Segment>
        <Segment  inverted>Janeiro</Segment>
        <Segment ></Segment>
      </Segment.Group>
    </div>
  );
}

export default App;
